import React ,{useState} from "react";


const Cont =()=>
{

    const[num,setNum]=useState(0);
    return(
        <button
         onClick={
             (()=>{
            setNum(num+1);
            },()=>
            {
                alert("I am clicked");
            })
            }>
            click me {num}
            </button>

    );
};

export default Cont;
